define({"topics" : [{"title":"AWS Credentials","shortdesc":"\n               <p class=\"shortdesc\">When <span class=\"ph\">Data Collector</span> uses the Amazon S3 executor, it must pass credentials to Amazon Web Services. \n               </p>\n            ","href":"datacollector\/UserGuide\/Executors\/AmazonS3.html#concept_bmp_zlg_vw","attributes": {"data-id":"concept_bmp_zlg_vw",},"menu": {"hasChildren":false,},"tocID":"concept_bmp_zlg_vw-d46e92989","topics":[]},{"title":"Create New Objects","shortdesc":"\n               <p class=\"shortdesc\">You can use the Amazon S3 executor to create new Amazon S3 objects and write the         specified content to the object when\n                  the executor receives an event record. \n               </p>\n            ","href":"datacollector\/UserGuide\/Executors\/AmazonS3.html#concept_mtm_dqx_m1b","attributes": {"data-id":"concept_mtm_dqx_m1b",},"menu": {"hasChildren":false,},"tocID":"concept_mtm_dqx_m1b-d46e93017","topics":[]},{"title":"Copy Objects","shortdesc":"\n               <p class=\"shortdesc\">You can use the Amazon S3 executor to copy an object to another location within the         same bucket when the executor\n                  receives an event record. You can optionally delete the         original object after the copy. The object must be under 5\n                  GB in size.\n               </p>\n            ","href":"datacollector\/UserGuide\/Executors\/AmazonS3.html#concept_v5j_pjr_f2b","attributes": {"data-id":"concept_v5j_pjr_f2b",},"menu": {"hasChildren":false,},"tocID":"concept_v5j_pjr_f2b-d46e93052","topics":[]},{"title":"Tag Existing Objects","href":"datacollector\/UserGuide\/Executors\/AmazonS3.html#concept_gjz_m42_31b","attributes": {"data-id":"concept_gjz_m42_31b",},"menu": {"hasChildren":false,},"tocID":"concept_gjz_m42_31b-d46e93097","topics":[]},{"title":"Configuring an Amazon S3 Executor","href":"datacollector\/UserGuide\/Executors\/AmazonS3.html#task_nky_cnm_f1b","attributes": {"data-id":"task_nky_cnm_f1b",},"menu": {"hasChildren":false,},"tocID":"task_nky_cnm_f1b-d46e93149","topics":[]}]});